class Solution:
    def threeSum(self, nums: list[int]) -> list[list[int]]:
        ans = []
        nums.sort()
        for ii in range(len(nums)-2):
            if ii > 0 and nums[ii] == nums[ii-1]:
                continue
            ret = self.twoSum(nums[ii+1:], -nums[ii])
            if ret == []:
                continue
            else:
                for jj in ret:
                    ans.append([nums[ii]] + jj)

        # remove the dups
        output = []
        for ii in ans:
            if ii not in output:
                output.append(ii)
        return output

    def twoSum(self, nums, target):
        d = {}
        ans = []
        for ii in nums:
            if ii in d:
                ans.append([ii, d[ii]])
            else:
                d[target - ii] = ii
        return ans



